import React from 'react';

function Input(props){
    return (
      <input
        onChange={props.onUpdateWord}
        value={props.word}/>
    )
  }

 const Search = (props) => {
  return (
    <form onSubmit={props.onSubmitWord}>
    <div>
      <Input type="text" onUpdateWord={props.onUpdateWord}  word={props.word}/>
      <button type="submit"/>
    </div>
    </form>
  );
}

export default Search;
